def longestIncreasingSubsequence(sequence):
    dp = [1] * len(sequence)

    for i in range(1, len(sequence)):
        dp[i] = max([dp[j] if sequence[j] < sequence[i] else 0 for j in range(i)]) + 1



    return max(dp)
